import React from 'react';

const Weather = () => {
  return (
    <div className="bg-gradient-to-r from-blue-400 to-purple-600 min-h-screen flex items-center justify-center relative">
      <video
        autoPlay
        loop
        muted
        className="absolute top-0 left-0 w-full h-full object-cover opacity-20"
      >
        <source src="/background-video.mp4" type="video/mp4" />
        Your browser does not support the video tag.
      </video>

      <div className="bg-white p-6 rounded-lg shadow-lg text-center relative z-10">
        <h1 className="text-3xl font-semibold text-gray-800 mb-4">Weather Information</h1>

        {/* Embed the Weather.com iframe here */}
        <iframe
          src="https://weather.com/weather/today/l/USNY0996:1:US"
          title="Weather Widget"
          width="300"
          height="250"
          frameBorder="0"
        ></iframe>
      </div>
    </div>
  );
};

export default Weather;
